syntax = "proto3";

package fintekkers.requests.price;

import "fintekkers/models/price/price.proto";
option java_multiple_files = true;

option java_outer_classname = "CreatePriceRequestProtos";

message CreatePriceRequestProto {
  string object_class = 1;
  string version = 2;

  fintekkers.models.price.PriceProto create_price_input = 20;
}


